import React, { Component } from 'react';

class Category extends Component{
    constructor(){
        super();
        this.setState({
            selectedCategoryId: ''
        })
    }
    onSelectCategory(id){
        this.setState({
            selectedCategoryId: id
        })
    }
    render(){
        return(
            <h2>Catgeory Page</h2>
        )
    }
}

export default Category;
